  <Popup style={pop} trigger={<button>Create an Event</button>} position="right center">
    <form>
        Event name:
        <input type="text" required/>
        Event Desc:
        <input type="text" required/>
        From
        <input type="date"/>
        <input type="time"/>
        To
        <input type="date"/>
        <input type="time"/>
        <input type="submit"/>

    </form>
  </Popup>
);
